La soluzione si sviluppa su due livelli ed è composto da ingresso su soggiorno e cucina a vista con accesso al terrazzo, due camere da letto e un bagno.
Richiesto Contratto Transitorio di 3 mesi (Dal 1° Giugno al 31 Agosto)

Caratteristiche principali:
- Splendida Vista sul Parco Sempione;
- Ottima Luminosità;
- Impianto di riscaldamento condominiale dotati di valvole termostatiche e impianto di raffrescamento/riscaldamento autonomo;
- Serramenti ad alta prestazione energetica ed acustica.Canone € 2.100,00 + € 400,00 (Comprensivi di tutte le spese : condominiali, utenze, tari e telefonia).Per visit
